/*Data for the table `college` */

insert  into `college`(`cid`,`cname`,`cleader`,`cmajorsum`,`cbanjisum`,`cinfo`) values (1,'能源学院','伍永平',4,25,'目前，能源学院拥有 1 个国家重点学科， 2 个陕西省重点学科， 2 个二级学科博士、硕士学位授予权点， 3 个本科专业中安全工程专业为陕西省名牌专业，采矿工程专业为国家管理专业。'),(2,'管理学院','李朋林',9,20,'管理学院现有教职工82人。其中教授3人，副教授及高级工程师16人，讲师及工程师45人，助教13人，助工2人，具有博士学位5人，在读博士17人，硕士学位48人，在读硕士6人。'),(3,'机械工程学院','张传伟',5,17,'学院现有教职工66人，其中教师48人，博士生导师2人，教授13人，副教授12人，高级工程师6人，博士后及博士15人，硕士以上学位教师37人。'),(4,'建筑与土木工程学院','谷栓成',7,21,'学院有教职工近100人，其中教授23人，博导10人，副教授（或相当专业技术职称）16人。教师中具有博士学位的7人，硕士学位的34人，在读博士22人。'),(5,'通信与信息工程学院','李国民',4,20,'现有1个博士点：矿业信息工程；2个一级学科：信息与通信工程和电子科学与技术；4个硕士点：通信与信息系统， 信号与信息处理，电路与系统，电磁场与电磁波；2005年在校本科生2100余名、硕士研究生近150名。'),(6,'电气与控制工程学院','付周新',4,23,'自动化系共有专业教师14人，其中教授2人、副教授4人、讲师8人，高级职称教师占43%；具有博士学位教师3人，在读博士4人，硕士学位以上教师占86%。'),(7,'测绘科学与技术学院','姚顽强',3,13,'学院现有省、部级专业技术拔尖人才2人，教授8人，副教授15人、讲师9人、助教2人，其中博士9人，在读博士9人。'),(8,'计算机科学与技术','李占利',4,10,'全系教职工76人，专职教师52人，其中：教授6人，副教授、高工职称教师20人，具有博硕士学历的教师占总数67%左右。'),(9,'人文与外国语学院','师新明',5,13,'学院现有教职工133人，行政管理人员17人，专任教师116人。其中教授7人、副教授16人、讲师78人、助教15人。具有博士学位4人（在读博士1人）、硕士学位80人，硕士以上学历占全体师资65.5%。'),(10,'地质与环境学院','赵晓光',5,14,'博士生导师5人，教授17人，副教授13人。专任教师队伍中具有博硕士学位教师占总数的82%。目前在校全日制本科生近千名，博、硕士研究生150余名。'),(11,'艺术学院','党兴民',3,6,'现有教职工48人，其中专职教师38人。在专职教师中，副教授1人，讲师19人，具有讲师职称以上教师占教师总数的52.6%；硕士（含在职攻读硕士学位）的有19人，占教师总数的50%。'),(12,'化学与化工学院','周安宁',6,17,'化学与化工学院现有教职工76名，其中专任教师54名，教授8名，博士生导师4名，副教授16名，高级工程师6名。专任教师中硕士、博士占教师总数的97%以上。'),(13,'材料科学与工程学院','王晓刚',4,13,'全院教职工42人，其中教授、博导、享受国务院特殊津贴和省级突出贡献的专家5人，副教授5人。2名博士后，9人具有博士学位，19人具有硕士学位。'),(14,'理学院','王雪峰',4,7,'现有教职工118人，其中教师102人，实验技术人员10人，行政6人；教师中有教授12人、副教授20人、中级职称59人、初级职称8人；教师中博士、在读博士22人、硕士75人、在读硕士4人，硕士以上学历教师人数已占教师总人数的80%。'),(15,'继续教育学院','杨梅忠',16,35,'学院广开办学渠道，坚持深入社会、厂矿企业进行调查研究，开设社会、企业需要和受欢迎的专业。');

